import React from 'react';

const Header = () => {
  return (
    <header>
      <h1>Hong Teng Lee</h1>
      <p>176 Duchess Avenue #03-05 Singapore: 269187</p>
      <p>Phone: +(65) 81681236</p>
      <p>Email: Leehongteng1999@gmail.com</p>
      <a href="https://www.linkedin.com/in/hongtenglee/" target="_blank" rel="noopener noreferrer">
        LinkedIn Profile
      </a>
    </header>
  );
};

export default Header;
